  name: keySet()
  nameWithType: TreeMultimap<K,V>.keySet()
  summary: |-
    Returns a view collection of all <i>distinct</i> keys contained in this multimap. Note that the
     key set contains a key if and only if this multimap maps that key to at least one value.

     <p>Changes to the returned set will update the underlying multimap, and vice versa. However,
     <i>adding</i> to the returned set is not possible.

     <p>Because a <code>TreeMultimap</code> has unique sorted keys, this method returns a <xref uid="NavigableSet" data-throw-if-not-resolved="false">NavigableSet</xref>, instead of the <xref uid="java.util.Set" data-throw-if-not-resolved="false">java.util.Set</xref> specified in the <xref uid="Multimap" data-throw-if-not-resolved="false">Multimap</xref>
     interface.
  overridden: com.azure.cosmos.implementation.guava25.collect.AbstractSortedKeySortedSetMultimap.keySet()
